(9, '5mMxFwJsDlY', 'Gokuldham ‡§µ‡§æ‡§∏‡•Ä ‡§π‡•Å‡§è ‡§ò‡§∞ ‡§Æ‡•á‡§Ç ‡§¨‡§Ç‡§¶! - Taarak Mehta Ka Ooltah Chashma-‡§§‡§æ‡§∞‡§ï ‡§Æ‡•á‡§π‡§§‡§æ- Ep 3121-12th March, 2021', 'Click here to watch the full episode of Taarak Mehta Ka Ooltah Chashmah:\nhttps://www.sonyliv.com/shows/taarak-mehta-ka-ooltah-chashmah-1700000084/bhogilal-calls-the-police-1000110953?watch=true\n\nClick here to subscribe to SAB TV: https://www.youtube.com/channel/UC6-F5tO8uklgE9Zy8IvbdFw?sub_confirmation=1\n\nClick here to subscribe to SonyLIV: http://www.sonyliv.com/signin\n\nClick here to watch all the episodes of Taarak Mehta Ka Ooltah Chashmah:  https://www.sonyliv.com/shows/taarak-mehta-ka-ooltah-chashmah-1700000084/jethalal-and-mehta-s-misunderstanding-1000104091?watch=true\n\nEpisode 3121: Bhogilal Tries To Run Away\n---------------------------------------------------------\nBhogilal locked Everyone inside Jethalals house and called the police. Bhogilal tries to run away but someone from Gokuldham has punctured his car and while Bhogilal and his lawyer reach the societys main gate Tapu Sena caught him. Can Jethalal save his Land and money?  Watch the full episode now.\n\nMore Useful Links :\n * Visit us at : http://www.sonyliv.com\n * Like us on Facebook : http://www.facebook.com/SonyLIV\n * Follow us on Twitter : http://www.twitter.com/SonyLIV\nAlso get Sony LIV app on your mobile\n * Google Play - https://play.google.com/store/apps/details?id=com.msmpl.livsportsphone\n * ITunes - https://itunes.apple.com/us/app/liv-sports/id879341352?ls=1&mt=8\n\nAbout Taarak Mehta Ka Ooltah Chashmah:\n----------------------------------------------------------------------\nThe show is inspired by the famous humorous column Duniya Ne Undha Chasma written by the eminent Gujarati writer Mr. Tarak Mehta. This story evolves around happenings in \"\"\"\"Gokuldham Co-operative Society\"\"\"\" and covers topical issues that are socially relevant. The show predominantly - Promoolves around Jethalaal (Dilip Joshi) who is an uneducated Gujarati businessman. Your Taarak Mehta (Sailesh Lodha), is his neighbor. Jethalaal finds a friend and philosopher in Taarak Mehta and often goes to him for advice whenever he is in trouble. Jethalaals family includes his simpleton wife Daya Ben (Disha Wakani) and a mischievous son Tapu (Bhavya Gandhi). Tapu is a menace and a constant source of trouble to all the members of Gokuldham. They have often warned Jethalaal to reform Tapu or else be prepared to leave the premises.', 'https://www.youtube.com/watch?v=5mMxFwJsDlY', 'https://i.ytimg.com/vi/5mMxFwJsDlY/defau', 'https://i.ytimg.com/vi/5mMxFwJsDlY/mqdef', 'https://i.ytimg.com/vi/5mMxFwJsDlY/hqdef', 'https://i.ytimg.com/vi/5mMxFwJsDlY/sddef', 'https://i.ytimg.com/vi/5mMxFwJsDlY/maxre', 3918198, 60203, 3993, 'UC6-F5tO8uklgE9Zy8IvbdFw', '2021-03-13 16:31:11', '2021-03-13 16:31:11'),
(10, 'ev3Io6IooSc', 'Chambdi Baba Bhagaye Bhoot | RajKummar Rao | Janhvi Kapoor | Varun Sharma | Ashish Chanchlani', 'Lo bhai aa gaya humara ek aur bollywood collab after ages\nRoohi is releasing on 11th March\nONLY AND ONLY IN CINEMAS\nJAANA AUR ZAROOR DEKHNA\nBhai maza aa gaya ye waale video mein kyunki apne iss video mein hai Rajkummar bhaiya, Varun bhai aur Janhvi Kapoor\nToh hum log jab goa mein apni mara rahe the tab apne @JioStudios  aur @Maddock Films  waalo ne apne ko bola ki bhai ek acha saa video bana na hai roohi ke star cast ke saath, waise toh bollywood collabs karna kaafi kamm kar diye hai (time nai re abhi ACV team ke paas, kaun mumbai jaye Ulhasnagar seüòÇüòÇ) lekin ye waali star cast mein apne Raj bhai hai, jo actor ke roop mein kuch zyada hi ache insaan hai‚ù§Ô∏è aur Varun Sharma ke saath toh apna pehle rishta tha\nToh hum mana nai kar paye\nPlus Janhvi pe apun ko crush tha üòÇüòÇ\nUpar se film ke producer Dinesh Vijan bhi kaafi respectful aur pyaare the, toh jab bhi bollywood se ache humble log milte (jo rare hota haiüòÇüòÇ) humara dil kehta ki inke saath toh kaam karna hi chahiye\nIslie bas humne kuch darawani movies dekhi apne bhootiyapa ko badaya aur ye script likhi jo hai chambdi baba ka part 2\nYe waala video end tak zaroor dekhna kyunki isme bahut masti hai aur kaafi zyada improvisation hai (all thanks to legend RAJKUMMAR RAO)\nProduction :\n@Jashan Sirwani  , @Tanish Sirwani  , @Ritesh Sadhwani  toh hamesha hi hote hai\nIs baar @Rohit Sadhwani  aur Grishim bhi chale kyunki bollywood ka collab tha, waise harami ke bache 2 din call nai uthate \nMain ek whatsapp kiya ki Rajkummar Rao se milne jaa rahe\nGhar ke neeche pahuch gaye saale\nIski script maine aur @Jashan Sirwani  ne saath mein likhi hai kyunki @Kunal Chhabhria  mc ko Ambernath se Ulhasnagar aane mein bhi bahut time lagta hai\nTraffic ne dhanda kharab kar diya hai\nShoot humara Cinderella @Siddharth Kedare aur @Kunal Chhabhria ne kiya kyunki camera inke paas girvi rehta hai... bhadepe chalate hai aur kamate hai, mujhse paise nahi lete hai iss liye inko jhelna padta hai.\nBaaki humara super super thanks to\nJio Studios jinhone hume phone karke ijjat diüòÇ\nMaddock films jinhone saamne se humari ijjat cheeni nahiüòÇ\nRajkummar Rao jinse bahut saari cheeze seekhni ko mili, jaise ki jitna zyada talented banda utna kam ghamandüî•\nVarun Sharma jinki comic timing aur expression meri acting distract kar rahi thi\nAur Janhvi Kapoor jinki maine raj bhai aur Varun bhai ne bahuuut taang kheechi üòÇüòÇ\nAll in all maza aa gaya please ye movie cinemas ke jaake zaroor dekhna\nROOHI IS RELEASING ON 11TH MARCH‚ù§Ô∏è\n\n#Roohi #11thMarch #AshishChanchlani #RajKummarRao #JanhviKapoor #VarunSharma #MaddockFilms #JioStudios', 'https://www.youtube.com/watch?v=ev3Io6IooSc', 'https://i.ytimg.com/vi/ev3Io6IooSc/defau', 'https://i.ytimg.com/vi/ev3Io6IooSc/mqdef', 'https://i.ytimg.com/vi/ev3Io6IooSc/hqdef', 'https://i.ytimg.com/vi/ev3Io6IooSc/sddef', 'https://i.ytimg.com/vi/ev3Io6IooSc/maxre', 10471892, 840670, 33994, 'UChmCol08IsWTety5a3rMh6w', '2021-03-13 16:31:20', '2021-03-13 16:31:20');

